import React from 'react'
import "./Sidebar.css";
import SidebarRow from "./SidebarRow";
import WhatshotIcon from "@material-ui/icons/Whatshot";
import SubscriptionsIcon from "@material-ui/icons/Subscriptions";
import HomeIcon from "@material-ui/icons/Home";



function Sidebar() {
    return (
        <div className="sidebar">
            <SidebarRow selected Icon = {HomeIcon} title ="Home"/>
            <SidebarRow Icon = {WhatshotIcon} title ="Trending"/>
            <SidebarRow Icon = {SubscriptionsIcon} title ="Subscription"/>
            <hr/>
            <SidebarRow Icon = {VideoLibraryIcon} title ="Library"/>
            <SidebarRow Icon = {SubscriptionsIcon} title ="History"/><SidebarRow selected Icon = {HomeIcon} title ="Home"/>
            <SidebarRow Icon = {WhatshotIcon} title ="Your videos"/>
            <SidebarRow Icon = {SubscriptionsIcon} title ="Watch Later"/>
            <SidebarRow Icon = {WhatshotIcon} title ="Liked videos"/>
            <SidebarRow Icon = {SubscriptionsIcon} title ="Show more"/>
        </div>
    )
}

export default Sidebar
